import React, { useEffect, useState } from 'react'
import { Link } from 'react-router-dom';

const ViewDashbord = () => {
  
    const [items,setitems]=useState([]);
    useEffect(()=>{
        fetch("http://localhost:5000/api/viewdashbord")
        .then(response=>response.json())
        // .then(data=>console.log(data))
        .then(data=>setitems(data))
        .catch(err=>console.log(err))
    },[]);
    
  return (
    <div>
       <h1 >View Data</h1>
      <table class="table table-dark">
  
  <tbody>
    <tr class="table-active">
        <th>Image</th>
        <th>Name</th>
        <th>Name</th>
           
      <th>createdAt</th>
      
    </tr>
    {
        items.map(item=>(
            <tr class="table-active" key={item._id}>
              <td><img style={{backgroundSize:"cover",height:"50px"}}src={item.Photo}></img></td>
              <td>{item.Name}</td>
                <td>{item.Email}</td>
                <td>{item.Passsword}</td>
                
                <td>{item.createdAt}</td>
                </tr>
        )
    )
    }

    
  </tbody>
</table>
<button className='' ><Link to="/contact">Add More</Link></button>
    </div>
  )
}

export default ViewDashbord;
